    false,nt"url": null,nt"notes": "The U.S. Geological Survey developed this
    dataset as part of the Colorado Front Range Infrastructure Resources Project (FRIRP).
    One goal of the FRIRP was to provide information on the availability of those hydrogeologic
    resources that are either critical to maintaining infrastructure along the northern
    Front Range or that may become less available because of urban expansion in the
    northern Front Range. This dataset extends from the Boulder-Jefferson County line
    on the south, to the middle of Larimer and Weld Counties on the North. On the west,
    this dataset is bounded by the approximate mountain front of the Front Range of
    the Rocky Mountains; on the east, by an arbitrary north-south line extending through
    a point about 6.5 kilometers east of Greeley. This digital geospatial dataset consists
    of digitized contours of unconsolidated-sediment thickness (depth to bedrock).",nt"license_title":
